import React from 'react';

// import { Container } from './styles';

export default function Demo(props) {
    const {data}=props;
    const modifiedData=Object.values(data)
    console.log(" Data",data)
    console.log("New Data",modifiedData)
  return (
    <div className="d-flex flex-wrap h-100 justify-content-center align-items-center w-100">
    {Object.keys(modifiedData).map((key,ind)=>(
        <div className="Card shadow w-25 p-3 rounded">
        <div className="d-flex flex-column align-items-start">
            <div className="mb-2"><span className="label"> {key}</span>{" : "} <span></span></div>
            </div>
    </div>
    
    ))}
    </div>
  );
}
